set serveroutput on size 100000;

--https://jira.aplana.com/browse/SBRFACCTAX-16017: Загрузить ОКТМО (новые записи)
create sequence SEQ_REF_BOOK_OKTMO_RECORD_ID start with 1000000;

declare
	v_cnt decimal(18) := 0;
begin

select count(*) into v_cnt from ref_book_oktmo;
dbms_output.put_line('OKTMO initial count: '||v_cnt||' rows');

merge into ref_book_oktmo tgt
using (
  with t as  (
       select o.*, substr(code, 3, 1) as digit3, substr(code, 6, 1) as digit6,
              substr(code, 1, 2) as grp1, substr(code, 3, 3) as grp2, substr(code, 6, 3) grp3, nvl(substr(code, 9, 3), '000') grp4
       from ref_book_oktmo o),
       pt as (
        select t.*,
               case when digit3 <> 0 and digit3 <> 8 and grp3 = '000' and grp4 = '000' and code <> grp1||digit3||'00000' then grp1||digit3||'00000'
                    when digit3 = 8 and substr(grp2, 2, 1) in (1,2,3,4) and grp3 = '000' and grp4 = '000' and code <> grp1||digit3||'10000' then  grp1||digit3||'10000'
                    when digit3 = 8 and substr(grp2, 2, 1) in (5,6,7,8,9) and grp3 = '000' and grp4 = '000' and code <> grp1||digit3||'50000' then grp1||digit3||'50000'
                    when grp2 in ('810', '850') and grp3 = '000' and grp4 = '000' then  grp1||digit3||'00000'
                    when digit6 <> 0 and grp4 = '000' and code <> grp1||grp2||digit6||'00' then grp1||grp2||digit6||'00'
                    when grp4 <> '000' then grp1||grp2||grp3
                    when grp4 = '000' and grp3 <> '000' then  grp1||grp2||'000'
                    when grp3 = '000' and grp2 <> '000' then  grp1||'000000' end as parent_code
        from t )
  select pt.id, o.id as parent_id
  from pt
  join ref_book_oktmo o on o.code = pt.parent_code and o.version = pt.version and pt.version = to_date('01.01.2012', 'DD.MM.YYYY')
  where o.id <> pt.parent_id  ) src
on (tgt.id = src.id)
when matched then
     update set tgt.parent_id = src.parent_id;

dbms_output.put_line('OKTMO fix initial hierarchy: '||sql%rowcount||' rows merged.');

	BEGIN
		update ref_book_oktmo set version = to_date('18.04.2014', 'DD.MM.YYYY') where code in ('35000000', '67000000') and version = to_date('01.01.2015', 'DD.MM.YYYY');
		
		
		update ref_book_oktmo set status = 0 where status = 1;
		dbms_output.put_line('OKTMO temp data: '||sql%rowcount||' rows updated.');

			merge into ref_book_oktmo tgt
			using (
			  with t as  (
				   select o.*, substr(code, 3, 1) as digit3, substr(code, 6, 1) as digit6,
						  substr(code, 1, 2) as grp1, substr(code, 3, 3) as grp2, substr(code, 6, 3) grp3, nvl(substr(code, 9, 3), '000') grp4
				   from ref_book_oktmo o),
				   pt as (
					select t.*,
						   case when digit3 <> 0 and digit3 <> 8 and grp3 = '000' and grp4 = '000' and code <> grp1||digit3||'00000' then grp1||digit3||'00000'
								when digit3 = 8 and substr(grp2, 2, 1) in (1,2,3,4) and grp3 = '000' and grp4 = '000' and code <> grp1||digit3||'10000' then  grp1||digit3||'10000'
								when digit3 = 8 and substr(grp2, 2, 1) in (5,6,7,8,9) and grp3 = '000' and grp4 = '000' and code <> grp1||digit3||'50000' then grp1||digit3||'50000'
								when grp2 in ('810', '850') and grp3 = '000' and grp4 = '000' then  grp1||digit3||'00000'
								when digit6 <> 0 and grp4 = '000' and code <> grp1||grp2||digit6||'00' then grp1||grp2||digit6||'00'
								when grp4 <> '000' then grp1||grp2||grp3
								when grp4 = '000' and grp3 <> '000' then  grp1||grp2||'000'
								when grp3 = '000' and grp2 <> '000' then  grp1||'000000' end as parent_code
					from t )
			  select pt.id, o.id as parent_id
			  from pt
			  join ref_book_oktmo o on o.code = pt.parent_code
			  where o.id <> nvl(pt.parent_id, -1)  ) src
			on (tgt.id = src.id)
			when matched then
				 update set tgt.parent_id = src.parent_id;

			dbms_output.put_line('OKTMO fix additional hierarchy: '||sql%rowcount||' rows merged.');
	EXCEPTION
		WHEN OTHERS THEN
			dbms_output.put_line('ERROR: Insert new records failed. Reason: ['||sqlerrm||']');
			rollback;	
	END;

select count(*) into v_cnt from ref_book_oktmo;
dbms_output.put_line('OKTMO final count: '||v_cnt||' rows');	
	
end;
/
COMMIT;

--restart sequences
declare 
	v_id decimal(18) := 0;
	v_seq decimal(18) := 0;
begin
  Select max(id) into v_id from ref_book_oktmo;
  if (v_id is not null) then 
    Select seq_ref_book_oktmo.NEXTVAL into v_seq from dual;
     IF (v_id > v_seq) THEN         
        execute immediate 'alter sequence seq_ref_book_oktmo INCREMENT BY '||TO_CHAR(v_id-v_seq); 
        Select seq_ref_book_oktmo.NEXTVAL into v_seq from dual;
        execute immediate 'Alter sequence seq_ref_book_oktmo INCREMENT BY 100';
		dbms_output.put_line('INFO: sequence SEQ_REF_BOOK_OKTMO altered. Current sequence value: '||v_seq);
     END IF;
  end if;
end;
/  

declare 
	v_id decimal(18) := 0;
	v_seq decimal(18) := 0;
begin
  Select max(record_id) into v_id from ref_book_oktmo;
  if (v_id is not null) then 
    Select seq_ref_book_oktmo_record_id.NEXTVAL into v_seq from dual;
     IF (v_id > v_seq) THEN         
        execute immediate 'alter sequence seq_ref_book_oktmo_record_id INCREMENT BY '||TO_CHAR(v_id-v_seq); 
        Select seq_ref_book_oktmo_record_id.NEXTVAL into v_seq from dual;
        execute immediate 'Alter sequence seq_ref_book_oktmo_record_id INCREMENT BY 1';
		dbms_output.put_line('INFO: sequence SEQ_REF_BOOK_OKTMO_RECORD_ID altered. Current sequence value: '||v_seq);
     END IF;
  end if;
end;
/  


COMMIT;
EXIT;